import React from 'react';
import './Task.css';

const Task = (props) => {
  //   const { id, title, timeStart, timeEnd } = props.task;

  {
    props.tasks.length > 0 ? (
      props.tasks.map((task) => (
        <div className='task-wrapper' key={task}>
          <div className='task-container'>
            {/* <div className='task-id'>{id}</div> */}
            <div className='task-name'>{task.tile}</div>
            <div className='time-start'>{task.timeStart}</div>
            <div className='time-end'>{task.timeEnd}</div>
          </div>

          <span className='task-remove'>
            <i className='fas fa-times'></i>
          </span>

          <span className='task-edit'>
            <i className='far fa-edit' style={{ color: 'green' }}></i>
          </span>
        </div>
      ))
    ) : (
      <div>No tasks</div>
    );
  }
};

export default Task;
